import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faGlobe } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  const [sidebarOpen, setSidebarOpen] = useState(false); // State for navbar1 sidebar
  const [navbar2Open, setNavbar2Open] = useState(false); // State for navbar2 sliding

  // Toggle for navbar1 (sidebar)
  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
    if (navbar2Open) setNavbar2Open(false); // Close navbar2 if it's open
  };

  // Toggle for navbar2 (sliding in from the right)
  const toggleNavbar2 = () => {
    setNavbar2Open(!navbar2Open);
    if (sidebarOpen) setSidebarOpen(false); // Close sidebar if it's open
  };

  return (
    <nav className="navbar">
      {/* Header Section (Logo and Hamburger menu for mobile) */}
      <div className="navbar-header">
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
        <div className="navbar1-desktop">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
          </ul>
        </div>
        <div className="navbar-hamburger" onClick={toggleSidebar}>
          <FontAwesomeIcon icon={faBars} />
        </div>
      </div>

      {/* Sidebar for navbar1 (mobile view) */}
      <div className={`sidebar ${sidebarOpen ? 'open' : ''}`}>
        <ul className="sidebar-menu">
          <li>Driver</li>
          <li>Rider</li>
          <li>Business</li>
          <li>Log in</li>
          <li>Sign up</li>
          <li><FontAwesomeIcon icon={faGlobe} /> En</li>
        </ul>
      </div>

      {/* Button to open navbar2 (sliding from right) */}
      <button className="navbar2-toggle" onClick={toggleNavbar2}>
        More Options
      </button>

      {/* Sliding navbar2 (mobile) */}
      <div className={`navbar2-mobile ${navbar2Open ? 'open' : ''}`}>
        <ul className="navbar-menu2">
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>

      {/* Navbar2 for desktop */}
      <div className="navbar2-desktop">
        <ul className="navbar-menu2">
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
